import Container from '../Container';
import MarginBlock from '../MarginBlock';

import styled from 'styled-components';

const StyledHeader = styled.header`
  width: 100%;
  display: flex;
  justify-content: space-between;
  align-items: flex-end;
`;

const CurrentRoute = styled.div`
  font-size: 22px;
  font-weight: 400;
  @media (max-width: 800px) {
    display: none;
  }
`;

const ChatIcon = styled.img`
  background: url()
`;

const LeftContainer = styled.div``;

const Header = ({ currentRoute }) => {
  return (
    <Container>
      <MarginBlock height="45px"></MarginBlock>
      <StyledHeader>
        <LeftContainer>
          <h1 style={{ fontSize: '16px', fontWeight: '400' }}>Sequilize War</h1>
          <p style={{ fontSize: '16px', fontWeight: '700' }}>LIVE</p>
        </LeftContainer>
        <CurrentRoute>{currentRoute}</CurrentRoute>
        <ChatIcon src="/images/terminal-icon.svg"  alt="/images/terminal-icon.svg" >123</ChatIcon>
        <img src="" alt=""/>
      </StyledHeader>
    </Container>
  );
};

export default Header;
